namespace ue_PCC_SQLInterrogator
{
    [IDOExtensionClass("PCC_SQLInterrogator")]
    public partial class PCC_SQLInterrogator : IDOExtensionClass
    {

        [IDOMethod(MethodFlags.None, "Infobar")]
        public String GetXML(string sqlCmdTxt, string TicketNumber, string Username, ref string dtXML, ref string Infobar)
        {
            var dt = GetData(sqlCmdTxt, TicketNumber, Username, ref Infobar); 
			dt.TableName="XML";
            //string dtXML;

            StringWriter sw = new StringWriter();
                dt.WriteXml(sw);
                dtXML= sw.ToString();

            //return dtXML;
            return "0";
        }
        
        [IDOMethod(MethodFlags.None, "Infobar")]
        public String GetJson(string sqlCmdTxt, string TicketNumber, string Username, ref string dtJSON, ref string Infobar)
        {
            var dt = GetData(sqlCmdTxt, TicketNumber, Username, ref Infobar); 
			dt.TableName="JSON";
			dtJSON = Newtonsoft.Json.JsonConvert.SerializeObject(dt);
            
            return "0";
        }
        
[IDOMethod(MethodFlags.CustomLoad, "Infobar")]
private DataTable GetData(string sqlCmdTxt, string TicketNumber, string Username, ref string Infobar)
        {
        	return GetData(sqlCmdTxt, TicketNumber, Username, 0, ref Infobar); 
        }

        [IDOMethod(MethodFlags.CustomLoad, "Infobar")]
        public DataTable GetData(string sqlCmdTxt, string TicketNumber, string Username, int IncludeColumnTitles, ref string Infobar)
        {
            string CmdType = "";
            string sqlCmdLog;
            DataTable results;
            DataTable resultsLog;
            if (string.IsNullOrEmpty(TicketNumber)) { TicketNumber = ""; }

            if (sqlCmdTxt.ToUpper().IndexOf("INSERT") > -1 || sqlCmdTxt.ToUpper().IndexOf("CREATE") > -1 || sqlCmdTxt.ToUpper().IndexOf("MERGE") > -1) { CmdType = "C"; }
            if (sqlCmdTxt.ToUpper().IndexOf("SELECT") > -1 || sqlCmdTxt.ToUpper().IndexOf("EXEC") > -1) { CmdType += "R"; }
            if (sqlCmdTxt.ToUpper().IndexOf("UPDATE") > -1 || sqlCmdTxt.ToUpper().IndexOf("ALTER") > -1 || sqlCmdTxt.ToUpper().IndexOf("RENAME") > -1) { CmdType += "U"; }
            if (sqlCmdTxt.ToUpper().IndexOf("DELETE") > -1 || sqlCmdTxt.ToUpper().IndexOf("DROP") > -1 || sqlCmdTxt.ToUpper().IndexOf("TRUNCATE") > -1) { CmdType += "D"; }

            sqlCmdLog = @"  INSERT INTO ue_PCC_SQLInterrogatorLog
                                (   CmdType
                                ,   ExecutedCmd
                                ,   ExecutedBy
                                ,   TicketNumber
                                )
                            VALUES
                                (   '" + CmdType + @"'
                                ,   '" + sqlCmdTxt.Replace("'", "''") + @"'
                                ,   '" + Username.Replace("'", "''") + @"'
                                ,   '" + TicketNumber.Replace("'", "''") + @"'
                                )";
            resultsLog = ExecuteSQL(sqlCmdLog);

            if (sqlCmdTxt.ToUpper().IndexOf("UE_PCC_SQLINTERROGATORLOG") > -1)
            {
                Infobar = "Cannot interact with ue_PCC_SQLInterrogatorLog table";
                sqlCmdTxt = "SELECT Error='" + Infobar + "'";
                results = ExecuteSQL(sqlCmdTxt);
                //return results;
            }
            else if (sqlCmdTxt.ToUpper().IndexOf("GRANT") > -1 || sqlCmdTxt.ToUpper().IndexOf("REVOKE") > -1)
            {
                Infobar = "Cannot alter permissions using this form";
                sqlCmdTxt = "SELECT Error='" + Infobar + "'";
                results = ExecuteSQL(sqlCmdTxt);
                //return results;
            }
            else if (TicketNumber=="" && (CmdType!="R" || sqlCmdTxt.ToUpper().IndexOf("EXEC") > -1))
            {
                Infobar = "Ticket number is required for anything other than a SELECT statement";
                sqlCmdTxt = "SELECT Error='" + Infobar + "'";
                results = ExecuteSQL(sqlCmdTxt);
                //return results;
            }

            results = ExecuteSQL(sqlCmdTxt);

if (IncludeColumnTitles==1){
            string[] arrayColumns = results.Columns.Cast<DataColumn>().Select(x => x.ColumnName).ToArray();
            string stringColumns = string.Join(",", arrayColumns);
            
            results.Columns.Add("ColumnNames", typeof(string)).SetOrdinal(0);
            if (results.Rows.Count > 0)
            {
            	results.Rows[0]["ColumnNames"] = stringColumns;
            }
            }

            return results;
        }
        private DataTable ExecuteSQL(string sqlCmdTxt)
        {
            Mongoose.IDO.DataAccess.ApplicationDB db = Mongoose.IDO.IDORuntime.Context.CreateApplicationDB();
			//db.Profile=1;
            db.Open();

            IDataReader dr = db.ExecuteReader(sqlCmdTxt);

            DataTable results = new DataTable();

            results.Load(dr);
            db.Close();
            db.Dispose();

            return results;
        }

    }
}
